                Data.map(
                    (item, index) =>{
                        return (
                            <Question
                                selectOnChange = {props.selectOnChange}
                                num = {index + 1}
                                idQuestion = {index + 1}
                                question = {item.question}
                                image = {item.image}
                                A = {item.A}
                                B = {item.B}
                                C = {item.C}
                                D = {item.D}
                                
                            />
                        )
                    }
                )
            }
        </Wrapper>
        
    )
}

export default ListQuestion;
